import React from "react";
import { Link } from "react-router-dom";
import "./inside-cave.css";

// TODO: Make new inside cave component

const Cave = () => {
  return (
    <div className="inside-cave-entrance--container">
      <ul className="inside-cave-entrance--ul">
        <div className="inside-cave-entrance--li">
          <li>
            <Link to="/inside-cave-left" className="arrow left">
              {/* Return */}
            </Link>
          </li>
          <li>
            <Link to="/inside-cave-right" className="arrow right">
              {/* Return */}
            </Link>
          </li>
        </div>

        <li>
          <Link to="/cave" className="arrow down">
            {/* Return */}
          </Link>
        </li>
      </ul>
    </div>
  );
};

export default Cave;
